import React, { Component } from 'react';
import { Button, Form } from 'react-bootstrap';


class Login extends Component {
    constructor() {
        super();
        this.state = {
          email: '',
          password: '',
          errors: {}
        };
      }
    onChange = e => {
        this.setState({ [e.target.id]: e.target.value });
      };
    onSubmit = e => {
        e.preventDefault();
    const userData = {
          email: this.state.email,
          password: this.state.password,
        };
    console.log(userData);
      };

    render() {
        const { errors } = this.state;
        return (
            <Form onSubmit={this.onSubmit}>
            <Form.Group controlId="email">
                <Form.Label>Email address</Form.Label>
                <Form.Control value={this.state.email} onChange={this.onChange} type="email" id='email' error={errors.email} placeholder="Enter email" />
            </Form.Group>
            <Form.Group controlId="password">
                <Form.Label>Password</Form.Label>
                <Form.Control value={this.state.password} onChange={this.onChange} type="password" id='password' error={errors.password} placeholder="Password" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        )
    }
}

export default Login;
